import React from 'react';
import Card from './Card';

function List(header, cards){
    const cardList = cards.map(card => <Card key= {card.id} title ={card.title} content={card.content} />);
    return (
        <section className="List">
            <header className="List-header">
                <h2>{header}</h2>
            </header>
            <div className="List-cards">
                {cardList}
            </div>
        </section>
    );
};

export default List();
